class GNN(torch.nn.Module):
    def __init__(self, hidden_channels):
        super().__init__()
        self.conv1 = SAGEConv(hidden_channels, hidden_channels)
        self.conv2 = SAGEConv(hidden_channels, hidden_channels)

    def forward(self, x: Tensor, edge_index: Tensor) -> Tensor:
        # A 2-layer GNN computation graph.
        # `ReLU` is the non-lineary function used in-between.
        x = self.conv1(x, edge_index).relu()
        x = self.conv2(x, edge_index)
        return x

# Our final classifier applies the dot-product between source and destination
# node embeddings to derive edge-level predictions:


class Classifier(torch.nn.Module):
    def forward(self, x_i: Tensor, x_j: Tensor, edge_label_index: Tensor) -> Tensor:
        # Convert node embeddings to edge-level representations:
        edge_feat_a = x_i[edge_label_index[0]]
        edge_feat_b = x_j[edge_label_index[1]]

        # Apply dot-product to get a prediction per supervision edge:
        return (edge_feat_a * edge_feat_b ).sum(dim=-1)


class Model(torch.nn.Module):
    def __init__(self, hidden_channels, node_types):
        super().__init__()
        # initial embeddings
        self.node_types = {}
        for n in node_types:
            self.node_types[n[0]]  = Embedding(n[1], hidden_channels)
            self.node_types[n[0]].to(device)

        # Instantiate homogeneous GNN:
        self.gnn = GNN(hidden_channels)

        # Convert GNN model into a heterogeneous variant:

        self.gnn = to_hetero(self.gnn, metadata=graph.metadata())

        self.classifier = Classifier()

    def forward(self, data) -> Tensor:
        x_dict = {}
        for i in self.node_types.keys():
            input_tensor = data[i].node_id
            # Using torch.clamp() to clamp the indices to the valid range.
            input_tensor_clamped = torch.clamp(input_tensor, 0, self.node_types[i].num_embeddings - 1)
            x_dict[i] = self.node_types[i](input_tensor_clamped)

        # `x_dict` holds feature matrices of all node types
        # `edge_index_dict` holds all edge indices of all edge types
        x_dict = self.gnn(x_dict, data.edge_index_dict)

        pred = self.classifier(
            x_dict["SRC_A"],
            x_dict["TGT_B"],
            data['SRC_A', 'to', 'TGT_B'].edge_label_index,
        )

        return pred


