train_losses=[]
total_loss = 0
total_examples = 0

def train():
    global train_losses
    global total_loss
    global total_examples

    model.train()
    optimizer.zero_grad()

    # Run `forward` pass of the model
    pred = model.forward(train_data)
    # Apply binary cross entropy
    loss = F.binary_cross_entropy_with_logits(pred, train_data['SRC_A', 'to', 'TGT_B'].edge_label)

    train_losses += [loss]

    loss.backward()
    optimizer.step()
    total_loss += float(loss) * pred.numel()
    total_examples += pred.numel()
    return float(loss)

